//dle.rae.es/ "},{referencia:"Skarlett costura. (s.f.). Métodos para añadir el margen de costura a tus patrones. Skarlett. ",link:"https://skarlett.es/anadir-margen-de-costura-patron/"}],glosario:[{termino:"Almilla",significado:"Del dim. De alma1, por su unión íntima con el cuerpo. 1. F. Especie de jubón, con mangas o sin ellas, ajustado al cuerpo. 2. F. Jubón cerrado, escotado y de manga corta que se ponía debajo de la armadura (Real Academia Española, s.f.)."},{termino:"Bitácora",significado:"2. M. Libro pequeño o conjunto de papel en que se lleva la cuenta y razón, o en que se escriben algunas noticias, ordenanzas o instrucciones. El cuaderno de millones, de la mesta (Real Academia Española, s.f.)."},{termino:"Canesú",significado:"Del fr. Canezou. 1. M. Cuerpo de vestido de mujer corto y sin mangas. 2. M. Pieza superior de la camisa o blusa a la que se pegan el cuello, las mangas y el resto de la prenda (Real Academia Española, s.f.)."},{termino:"Desahogo",significado:"3. M. Ensanche, dilatación, esparcimiento (Real Academia Española, s.f.)."},{termino:"Derrotero",significado:"1. M. Camino, rumbo, medio tomado para llegar al fin propuesto. 2. M. Conjunto de datos que indican el camino para llegar a un lugar determinado (Real Academia Española, s.f.)."},{termino:"Elongación",significado:"1. F. Alargamiento. 3. F. Mec. Alargamiento de una pieza sometida a tracción (Real Academia Española, s.f.)."},{termino:"Holgura",significado:"1. F. Espacio suficiente para que pase, quepa o se mueva dentro algo. 2. F. Anchura sobrada. 3. F. Espacio vacío entre dos piezas que han de encajar una en otra. 4. F. Desahogo, bienestar, disfrute de recursos suficientes (Real Academia Española, s.f.)."},{termino:"Industrialización",significado:"1. F. Acción y efecto de industrializar."},{termino:"Industrializar",significado:"1. Tr. Hacer que algo sea objeto de industria o elaboración (Real Academia Española, s.f.)."},{termino:"Onda",significado:"2. F. Cada una de las curvas, a manera de e